module.exports = {
  root: true,
  env: {
    node: true,
  },
  extends: [
    'plugin:vue/vue3-essential',
    'eslint:recommended',
    '@vue/typescript/recommended',
    '@vue/prettier',
    '@vue/prettier/@typescript-eslint',
  ],
  parserOptions: {
    ecmaVersion: 2020,
  },
  rules: {
    'no-console': process.env.NODE_ENV === 'production' ? 'warn' : 'off',
    'no-debugger': process.env.NODE_ENV === 'production' ? 'warn' : 'off',
    'prettier/prettier': [
      'warn',
      {
        singleQuote: true,
      },
    ],
  },
};

module.exports = {
  presets: ['@vue/cli-plugin-babel/preset'],
  plugins: [
    [
      'import',
      {
        libraryName: 'ant-design-vue',
        libraryDirectory: 'es',
        style: 'css', // or 'css'
      },
      'ant-design-vue',
    ],
    [
      'import',
      {
        libraryName: '@ant-design/icons-vue',
        libraryDirectory: 'lib/icons',
        camel2DashComponentName: false,
      },
      '@ant-design/icons-vue',
    ],
  ],
};

exports.default = async function () {
  const fs = require('fs');
  const compressing = require('compressing');

  const src = './build/mac/rubick.app/Contents/Resources/app.asar';
  if (fs.existsSync(src)) {
    await compressing.gzip.compressFile(src, 'build/app.asar.gz');
  }
};

// eslint-disable-next-line @typescript-eslint/no-var-requires
const path = require('path');

module.exports = {
  // transpileDependencies: ["fix-path"],
  configureWebpack: {
    resolve: {
      alias: {
        '@': path.join(__dirname, './src'),
      },
    },
  },
  pages: {
    index: {
      entry: 'src/renderer/main.ts',
    },
  },
  productionSourceMap: false,
  pluginOptions: {
    electronBuilder: {
      nodeIntegration: true,
      mainProcessFile: 'src/main/index.ts',
      mainProcessWatch: ['src/main'],
      externals: [
        'pouchdb',
        'extract-file-icon',
        'npm',
        'electron-screenshots',
        '@electron/remote',
      ],
      // Use this to change the entry point of your app's render process. default src/[main|index].[js|ts]
      builderOptions: {
        productName: 'rubick',
        appId: 'com.muwoo.rubick',
        compression: 'maximum',
        // afterPack: './release.js',
        // afterAllArtifactBuild: () => {
        //   return ['./build/app.asar.gz'];
        // },
        directories: {
          output: 'build',
        },
        releaseInfo: {
          releaseName: 'normal', // normal 弹窗 / major 强制更新
          releaseNotesFile: './release/releaseNotes.md',
        },
        publish: [
          {
            provider: 'github',
            owner: 'rubickCenter',
            repo: 'rubick',
          },
        ],
        // files: ["dist_electron/**/*"],
        dmg: {
          contents: [
            {
              x: 410,
              y: 150,
              type: 'link',
              path: '/Applications',
            },
            {
              x: 130,
              y: 150,
              type: 'file',
            },
          ],
        },
        mac: {
          icon: 'public/icons/icon.icns',
          target: [
            {
              target: 'dmg',
              arch: ['x64', 'arm64'],
            },
          ],
          artifactName: 'rubick-${version}-${arch}.dmg',
          gatekeeperAssess: false,
          entitlementsInherit: './release/entitlements.mac.plist',
          entitlements: './release/entitlements.mac.plist',
          hardenedRuntime: true,
          category: 'public.app-category.developer-tools',
          extendInfo: {
            LSUIElement: 1,
          },
        },
        win: {
          icon: 'public/icons/icon.ico',
          artifactName: 'rubick-Setup-${version}-${arch}.exe',
          target: [
            {
              target: 'nsis',
              arch: ['x64', 'ia32'],
            },
          ],
        },
        nsis: {
          shortcutName: 'rubick',
          oneClick: false,
          allowToChangeInstallationDirectory: true,
          include: 'public/installer.nsh',
        },
        linux: {
          icon: 'public/icons/',
          publish: ['github'],
          target: 'deb',
        },
      },
    },
  },
};
